import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';
import { styled } from '@mui/material/styles';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import CancelIcon from '@mui/icons-material/Cancel';
import CloudDownloadIcon from '@mui/icons-material/CloudDownload';
import { downloadTestResults } from './api';

const columns = [
  { id: 'location_a', label: 'Location A' },
  { id: 'location_b', label: 'Location B' },
  { id: 'circuit_id', label: 'UCN' },
  { id: 'expected_latency', label: 'Expected Latency' },
  { id: 'live_latency', label: 'Live Latency' },
  { id: 'bandwidth', label: 'Bandwidth' },
  { id: 'underlying_carrier', label: 'Underlying Carrier' },
  { id: 'cable_system', label: 'Cable System' },
  { id: 'is_special', label: 'Special/ULL' },
  { id: 'kmz_file_path', label: 'KMZ File' },
  { id: 'test_results_link', label: 'Test Results' },
  { id: 'outage_tickets_last_30d', label: 'Outage Tickets (30d)' },
  { id: 'maintenance_tickets_last_30d', label: 'Maintenance Tickets (30d)' },
  { id: 'more_details', label: 'More Details' },
];

const textCellStyle = {
  maxWidth: 220,
  maxHeight: 80,
  overflow: 'auto',
  whiteSpace: 'pre-line',
  wordBreak: 'break-word',
  padding: '6px 8px',
};

const SmallTableCell = styled(TableCell)(({ theme }) => ({
  fontSize: '0.75rem', // ~12px, 2pt smaller than default
  padding: '6px 8px',
}));

const SmallTableHeaderCell = styled(TableCell)(({ theme }) => ({
  fontSize: '0.8125rem', // ~13px, 2pt smaller than default header
  fontWeight: 600,
  padding: '6px 8px',
}));

function NetworkRoutesTable({ rows, onMoreDetails, onSelectRow, selectedRow, onOpenDarkFiber }) {
  const handleDownloadKMZ = (filename) => {
    window.open(`/backend/kmz_files/${filename}`, '_blank');
  };
  const handleDownloadTestResults = async (circuit_id) => {
    try {
      const res = await downloadTestResults(circuit_id);
      const url = window.URL.createObjectURL(new Blob([res.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', 'test_results');
      document.body.appendChild(link);
      link.click();
      link.remove();
    } catch (e) {
      alert('Failed to download test results file');
    }
  };
  return (
    <TableContainer component={Paper}>
      <Table size="small">
        <TableHead>
          <TableRow>
            {columns.map(col => (
              <SmallTableHeaderCell key={col.id}>{col.label}</SmallTableHeaderCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.circuit_id}
              hover
              selected={selectedRow && selectedRow.circuit_id === row.circuit_id}
              onClick={() => onSelectRow && onSelectRow(row)}
              style={{ cursor: onSelectRow ? 'pointer' : 'default' }}
            >
              {columns.map(col => {
                if (col.id === 'more_details') {
                  return (
                    <SmallTableCell key={col.id} style={textCellStyle}>
                      <Button variant="outlined" size="small" onClick={e => { e.stopPropagation(); onMoreDetails(row); }}>
                        More Details
                      </Button>
                    </SmallTableCell>
                  );
                }
                if (col.id === 'bandwidth' && row.bandwidth === 'Dark Fiber') {
                  return (
                    <SmallTableCell key={col.id} style={textCellStyle}>
                      <Button variant="contained" size="small" color="secondary" onClick={e => { e.stopPropagation(); onOpenDarkFiber(row.circuit_id); }}>
                        Dark Fiber Details
                      </Button>
                    </SmallTableCell>
                  );
                }
                if (col.id === 'kmz_file_path') {
                  return (
                    <SmallTableCell key={col.id} style={textCellStyle} align="center">
                      {row.kmz_file_path ? (
                        <Button onClick={e => { e.stopPropagation(); handleDownloadKMZ(row.kmz_file_path); }} color="success" size="small" startIcon={<CheckCircleIcon color="success" />}>
                          <CloudDownloadIcon fontSize="small" />
                        </Button>
                      ) : (
                        <CancelIcon color="error" />
                      )}
                    </SmallTableCell>
                  );
                }
                if (col.id === 'test_results_file') {
                  return (
                    <SmallTableCell key={col.id} style={textCellStyle} align="center">
                      {row.test_results_file ? (
                        <Button onClick={e => { e.stopPropagation(); handleDownloadTestResults(row.circuit_id); }} color="success" size="small" startIcon={<CheckCircleIcon color="success" />}>
                          <CloudDownloadIcon fontSize="small" />
                        </Button>
                      ) : (
                        <CancelIcon color="error" />
                      )}
                    </SmallTableCell>
                  );
                }
                const textHeavy = [
                  'test_results_link',
                  'cable_system',
                  'underlying_carrier',
                  'location_a',
                  'location_b',
                  'bandwidth',
                  'more_details',
                ];
                return (
                  <SmallTableCell key={col.id} style={textHeavy.includes(col.id) ? textCellStyle : {}}>
                    {col.id === 'is_special' ? (row[col.id] ? 'Yes' : 'No') : row[col.id]}
                  </SmallTableCell>
                );
              })}
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default NetworkRoutesTable;
